import React from "react";
import BorderColorIcon from "@material-ui/icons/BorderColor";
function Header() {
  return (
    <header>
      <h1>
        <BorderColorIcon fontSize="large" />
        Keeper
      </h1>
    </header>
  );
}

export default Header;
